import {React, useState, useEffect} from 'react'
import DashTable from './DashTable'

const RoleSelect = (props) => {

    useEffect(()=>{
        axios.get('https://dct-application-form.herokuapp.com/users/application-forms')
        .then((response)=>{
            console.log(response.data)
        })
        .catch((err)=>{
            console.log(error.message)
        })
    })

    return (
        <div>
            <button>All</button>
            <button>Front-End Developer</button>
            <button>Node.js Developer</button>
            <button>MEAN Stack Developer</button>
            <button>FULL Stack Developer</button>
            <DashTable/>
        </div>
    )
}

export default RoleSelect
